src:
انقلاب في موقف &quot;التيار الوطني الحرّ&quot;
07 Nov 2019, 00:49 by Lebanon 24
تحدثت أوساط سياسية عن انقلاب في موقف "التيار الوطني الحر" لجهة القبول بمبدأ تشكيل حكومة تكنوقراط، وفقاً لتسريبات جديدة عن اللقاء الذي جمع رئيس التيار جبران باسيل، ورئيس الحكومة المستقيل سعد الحريري.

text:
A coup in the position of & quot; FPM & quot;
07 Nov 2019, 00:49 by Lebanon 24
Political circles talked about a coup in the position of the "Free Patriotic Movement" in terms of accepting the principle of forming a government of technocrats, according to new leaks from the meeting between the current leader Gibran Bassil, and the resigned Prime Minister Saad Hariri.
